			controller_selector_2.id="currencies_"+parent_div_ID;
			var controller_button=document.createElement('button');
			controller_button.className="btn btn-sm";
			controller_button.innerHTML="Update";
			$(controller_button).attr('onClick','updateSingleChart("'+parent_div_ID	+'")');
			controller_div.append(controller_selector_1);
			controller_div.append(controller_selector_2);
			controller_div.append(controller_button);
			widget_height_dictionary={"col-sm-12": "475","col-sm-9": "400","col-sm-8": "350","col-sm-6": "300"};
			placeholder_widget=document.createElement('coingecko-coin-price-chart-widget');
