function generateSelectionWidget(column_class)
{
	var selection_widget=document.createElement('div');
	selection_widget.className="widget_selection";
	var selection_widget_list=document.createElement('select');
	selection_widget_list.className="widget_select_options";
	var matchable_widgets={"col-sm-12":["4","2","5","7"],"col-sm-6":["4","2","5","7"],"col-sm-9":["4","2","5","7"],"col-sm-8":["4","2","5","7"],"col-sm-4":["1","3","6","7","9"],"col-sm-3":["9","1","3","6","7"]};
	var widget_ID_to_Name={"1":"Simple Converter Widget","2":"Live Coin Chart","3":"Top Cryptocurrencies","9": "Tweets","4":"Cryptocurrency Heatmap","5":"Compare Cryptocurrencies","6":"Single Coin Details","7":"Horizontal Ticker","8":"ICO Calendar"};
	var i;
	for (i = 0; i < matchable_widgets[column_class].length; i++) 
	{ 
		var widget_option=document.createElement('option');
		widget_option.innerHTML=widget_ID_to_Name[matchable_widgets[column_class][i]];
		widget_option.value=matchable_widgets[column_class][i];
		if (i==0)
		{
			widget_option.selected="selected";	
		}
		selection_widget_list.append(widget_option);
	}
	var widget_selection_button=document.createElement('button');
	widget_selection_button.className="btn btn-sm";
	$(widget_selection_button).attr('onClick',"updateElement(this)");
	widget_selection_button.innerHTML="Add Widget";
	selection_widget.append(selection_widget_list);
	selection_widget.append(widget_selection_button);
	return selection_widget.outerHTML;
}
function updateSingleChart(argument)
{
	document.getElementById("single_chart_"+argument).setAttribute("coin-id",document.getElementById("coins_"+argument).value);
	document.getElementById("single_chart_"+argument).setAttribute("currency",document.getElementById("currencies_"+argument).value);
}
function updateTwitterHandle(argument)
{
	$("#simple_tweet_"+argument).attr('href',("https://twitter.com/"+(document.getElementById("twitter_handle_"+argument).value)+"?ref_src=twsrc%5Etfw"));
}
